import React from 'react'
import Room from './Rooms';

export default function RoomsList({rooms}) {
    console.log(rooms)
    return (
        <div className="room-list">
            {rooms.map(item =>{
                return <Room rooms={item} className="room-list-centered"></Room>
            })}
        </div>
    )
}
